@ptn・8 As the incentive mechanism on PTN nears completion, we will be removing orders and positions from the public dashboard. Apps will still have real-time access to the signals as they purchase the output. However, we have received feedback from miners expressing concerns about the public dashboard. Since public viewers do not pay for this data and may contribute to signal degradation, this could impact the research quality for miners. Keeping the data publicly visible without sufficient value exchange risks undermining the miners’ ability to maintain high-quality output.

Miners will still have access to the local dashboard to view their orders in real-time, and we remain committed to enhancing the local dashboard to improve their experience.

We will also be rolling out new grafana dashboards over the next couple weeks highlighting miner performance metrics & KPIs related to the network. This will be to give more in depth information for miners against their peers, and to track improvement of the network over time.

@ptn・8 Hi everyone, as you may know, we have been hard at work on a plagiarism detection system over the past few months. We will be releasing a PR for the system this week, but want to provide some insight into the operating principles and history of development we’ve been pursuing behind the scenes. We’re releasing a white paper which outlines this process, which can be found here: https://docs.taoshi.io/PlagiarismWhitePaper.pdf.

In general, tracking plagiarism will help improve the stability of our network and protect the signal integrity of our miners who have trained custom models. The initial roll-out will be in ghost mode, and won’t affect miners as we will only be tracking statistics to ensure smooth operation.

The full integration with eliminations is set to release sometime in the next few weeks after we finish thoroughly testing. Looking forward to your feedback!

@ptn・8 , we want to make you aware of some work we have been doing behind the scenes and are looking to introduce in the coming month. Currently, we use a suite of risk profiling tools to evaluate the quality of our miners. This suite uses positional returns at its core to look at the health of miner returns and portfolio value growth over time. 

We are exploring new techniques of risk mitigation, which will incorporate more information about the miner's strategy as part of the scoring criteria. By incorporating auxiliary information such as per order risk and a behavioral bucketing, we will be able to more holistically evaluate the quality of each miner. We are also looking to make tweaks to our existing penalties to better identify effective exit strategies from our miners, so be prepared some some slight changes. 

In general, our target strategy is one with a clear risk management. Our ideal traders will set boundaries for their ideal targets on profit and loss on each position, and will likely only have one order per position with predictable losses. We will be releasing more notes on these changes in the coming weeks, as well as a broader roadmap on how PTN may evolve. We will continue to communicate these changes and keep our miners aware of these changes in advance.

