@ptn・8  Attention miners, we are planning to deprecate the *PositionInspector* in the miner&validator scripts in a few days. This functionality was important in the early days of the SN for verifying order fills. However, now that the local dashboard is released, *PositionInspector* is obsolete. The local dash is the source of truth for confirming orders. Please reach out if you were relying on *PositionInspector* for anything that is not available in the local dashboard and we can discuss options.

Q: How to verify validator-level data without *PositionInspector*?

A: This is something we can eventually add to the local dash. however, we don't recommend miners try to track and fix orders on individual validators. Due to the PTN sync mechanism, validators communicate with each other and fill in missing data automatically. Additionally, the miner script has a retry mechanism already baked in.
